package com.example.kafka_test.database;

import lombok.Getter;
import lombok.Setter;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.core.io.Resource;
import org.springframework.core.io.ResourceLoader;
import org.springframework.stereotype.Component;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.nio.file.Files;

@Component
@Getter
@Setter
public class BioData {

     @Autowired
     ResourceLoader resourceLoader;

     String faceBioData = "";
     String thumbBioData= "";

     public String getLeftEyeBioData() throws IOException {

          Resource resource = resourceLoader.getResource("classpath:lefteye.txt");
          String LeftEye;
          try (BufferedReader reader = new BufferedReader(new InputStreamReader(resource.getInputStream()))) {
               StringBuilder sb = new StringBuilder();
               String line;
               while ((line = reader.readLine()) != null) {
                    sb.append(line);
               }
               LeftEye = sb.toString().trim();
          }
          return LeftEye;
     }

     public String getRightEyeBioData() throws IOException {

          Resource resource = resourceLoader.getResource("classpath:righteye.txt");
          String RightEye;
          try (BufferedReader reader = new BufferedReader(new InputStreamReader(resource.getInputStream()))) {
               StringBuilder sb = new StringBuilder();
               String line;
               while ((line = reader.readLine()) != null) {
                    sb.append(line);
               }
               RightEye = sb.toString().trim();
          }
          return RightEye;
     }





}
